import React, { FC, Suspense, lazy, useMemo } from 'react'
import styles from './button.module.css'
import { Link, Route } from 'react-router-dom'

const PopupTweet = useMemo(() => lazy(() => import('../../../PopupTweet/PopupTweet')), [])

type props = {
  SetPostNews: any
}

export const Button: FC<props> = React.memo(({ SetPostNews }) => {
  return (
    <>
      <Link to="/popup" className={styles.btnFont} data-testid="testBtn">
        Tweet
      </Link>
      <Suspense fallback={<div>Loading...</div>}>
        <Route path="/popup" component={() => <PopupTweet SetPostNews={SetPostNews} />} />
      </Suspense>
    </>
  )
})
